import React from "react";
import { Link } from "react-router-dom";

const AdminOrdersPage = () => {
  return (
    <div>
      <h1>AdminOrdersPage</h1>
      <Link to="/admin/users">Users</Link>
      <Link to="/admin/products">Products</Link>
    </div>
  );
};

export default AdminOrdersPage;
